import React, { Component } from 'react';
import './App.css';
import { Alert } from 'reactstrap';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';

  export default class Example extends React.Component {
    constructor(props) {
      super(props);

      this.toggle = this.toggle.bind(this);
      this.state = {
        isOpen: false
      };
    }
    toggle() {
      this.setState({
        isOpen: !this.state.isOpen
      });
    }
    render() {
      return (
        <div>
          <nav id="navbar" class="navbar sticky-top navbar-expand-lg navbar-light">
                    <h1 class="float-right display-5 text-black-50 font-weight-bold">Health Is Wealth</h1>
                    <ul class="navbar-nav mr-auto">
                            <form class="form-inline my-2 my-lg-0 p-2">
                                    <a class="nav-link" href="#"><h4 id="navbarText" class="pl-5">Home</h4></a>
                                    <a class="nav-link" href="#"><h4 id="navbarText" class="pl-5">Tests</h4></a>
                                    <a class="nav-link" href="#"><h4 id="navbarText" class="pl-5">About Us</h4></a>
                            </form>
                    </ul>
                    <img src="logo.png" alt="GC" width="70" height="70"></img>
            </nav>
        </div>
      );
  }
}
